DROP DATABASE IF EXISTS imdb;
CREATE DATABASE IF NOT EXISTS imdb; 
USE imdb;

DROP TABLE IF EXISTS filmes;
CREATE TABLE IF NOT EXISTS filmes(
  id_filme		INT PRIMARY KEY auto_increment
  ,titulo       VARCHAR(255) NOT NULL 
  ,avaliacao    NUMERIC(3,1) NOT NULL
  ,ano          INTEGER  NOT NULL
  ,faixa_etaria VARCHAR(9) NOT NULL
  ,genero       VARCHAR(25) NOT NULL
  ,diretor      VARCHAR(155) NOT NULL
  ,elenco       VARCHAR(155) NOT NULL
  ,meta_score   NUMERIC(5,1) NOT NULL
  ,poster_src   VARCHAR(255) NOT NULL
  ,duracao      NUMERIC(5,1) NOT NULL
);
